class Solution:
    def specialPalindrome(self, n: int) -> int:
        # 用打表的方式。我们首先需要知道一个数字是否符合题目要求，也就是：1.回文；2.各个数字出现次数等于它们本身。那么我们需要一个check函数来判断给出的数字是否合法。但是如果从0到10**15直接循环判断，计算量太大，因此可以想到通过给出的数字来直接构造回文数，然后进行判断。那么如果要构造回文数，就要面临æº的数字长度是奇数还是偶数的问题，注意到根据题目可以知道，如果数字中有一个奇数，那么由于需要构造回文数，这个奇数需要被排到中间位置。因此，在构造的时候，如果传入的数字结尾是奇数，就说明这个数字可以根据最后一个数字对称形成一个可能合法的长度为奇数的数字。否则，这个数字就需要通过续上它自身的反转来构成一个长度为偶数的回文数。这样，只需要传入一ä的数字就可以直接构造长度最大为16的合法回文数，这样就可以节省更多的时间。为了方便打表，对于check函数的返回值，可以直接将它设置为合法的回文数，即，如果合法，那么返回构造出来的数字，否则，返回空字符串
        # 当然，如果在代码中直接打表，可能超时，因此我们需要将它提前在外面处理，也就是在其他窗口中先行算出所有合法的数字，然后将其排序后复制到当前页é¥用二分查找来查询即可。这样最快
        return lst[bisect_left(lst, n+1)]

